from django import template
from django.template.defaultfilters import stringfilter


register = template.Library()

@register.filter
@stringfilter
def name(block_id):    
    return " ".join([word.capitalize() for word in block_id.split(":")[1].replace("_", " ").split(" ")])

@register.filter
def with_idx(iterable):
    return enumerate(iterable)

@register.filter
@stringfilter
def get_img(blockid):
    return imgs[blockid.replace("minecraft:", "")]

